    if (falseCase) {
        expect(attributeValue).not.toEqual(
            expectedValue,
            `${attrType}: ${attrName} of element "${selector}" should `
            + `not contain "${attributeValue}"`
        );
    } else {
        expect(attributeValue).toEqual(
            expectedValue,
            `${attrType}: ${attrName} of element "${selector}" should `
            + `contain "${attributeValue}", but "${expectedValue}"`
        );
    }
};

